      let Qgw2 = Calculation_Qgw(Q2, d2, q, Yp2);
      Cs2 = Calculation_Cs(Q2, C0, Cr, Qr2, Qgw2);
      Tf2 = Calculation_Tf(d2, q, n, Yp2);
      result += `
      Cs2, середня мінералізація у водозаборі 1 джерела - ${Cs2}`;
      result += `
