    } else if (Cs1 < Cs2) {
      result += `
      Якість води у разі водовідбору у джерела 2 гірше.`;
    } else
      result += `
      Якість води у разі водовідбору у джерел 1 та 2 однакова.`;

    if (Tf1 > Tf2) {
